notes:
Because of the non-competitive designation of this event, all race categories have been carefully considered.  Juniors go before their parents &#x28;Masters&#x29;, ladies go before gentlemen and slower goes before faster.  Its as simple as that. So in keeping it simple:

1.	11:00 Juniors &#x28;12-17 yr. olds&#x29; 
2.	12:00 Masters 40+ &#x28;women and men&#x29;
3.	1:00 Open Women &#x28;18+&#x29;
4.	2:00 Open Men &#x28;18+&#x29;
5.	3:00 Women Cat 1/2/3
6.	4:00 Men Cat 1/2/3
Junior and Open races are 30 minutes, while Masters and Cat 1/2/3 are 45 minutes long.
